import React from 'react';
import {ReactDOM} from 'react-dom';
import './index.css';
import App from './App';
import { ThemeProvider } from '@mui/material';
import './bootstrap/dist/css/bootstrap.css';




ReactDOM.render(
  <ThemeProvider>
    <CssBaseline />
    <App />
  </ThemeProvider>,
  document.getElementById('root')
);
